import React, { useState } from 'react';
import Navbar from './Navbar/Navbar';

function Home() {
    const [dashboard, setDashboard] = useState<boolean>(true);
    const [data, setData] = useState<boolean>(false);

    const showDashboard = () => {
        setDashboard(true);
        setData(false);
    }

    const showData = () => {
        setData(true);
        setDashboard(false);
    }

    return (
        <div>
            <Navbar 
                dashboard={dashboard}
                data={data}
                showDashboard={showDashboard}
                showData={showData}
            />
        </div>
    );
}

export default Home;
